script: |
  super -f text -I q8432.spq | sort > q8432.out

inputs:
  - name: q8432.spq
    data: |
      SELECT DISTINCT col2 / - ( col0 ) + 97 col1, col1 + + col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q8432.out
    data: |
      94	128
      96	100
      97	31
